// boxData.js
const boxData = [
  {
    id: 1,
    text: "자율성과 책임의 추구",
    label: "1순위"
  },
  {
    id: 2,
    text: "타인을 돕고 싶은 따뜻한 마음",
    label: "2순위"
  },
  {
    id: 3,
    text: "성과 중심, 인정받고 싶은 욕구",
    label: "3순위"
  },
  {
    id: 4,
    text: "내면 세계와 진정성의 탐색",
    label: "X"
  },
  {
    id: 5,
    text: "지식과 거리두기를 통한 안전",
    label: null
  },
  {
    id: 6,
    text: "신뢰와 안전의 추구",
    label: null
  },
  {
    id: 7,
    text: "경험의 확장과 즐거움 추구",
    label: null
  },
  {
    id: 8,
    text: "힘과 통제를 통한 존재감 유지",
    label: null
  },
  {
    id: 9,
    text: "갈등 회피와 평화 유지",
    label: null
  }
];

export default boxData;
